import React from "react";
import endFooter from "../../data/footer.json";

const EndFooter = () => {
  return endFooter.map((item) => (
    <ul className="" key={item.col_number}>
      <li>{item.col_values}</li>
    </ul>
  ));
};
export default EndFooter;
